import React from 'react';
import { ProductCardView } from './ProductCardView';

const ProductList = ({ products, handler }) => {
  return (
    <div className="row">
      {products.map((prod) => (
        <div className="cotenedor" key={prod.id}>
          <ProductCardView
            handler={handler}
            id={prod.id}
            name={prod.name}
            image={prod.image}
            description={prod.description}
            price={prod.price}
          />
        </div>
      ))}
    </div>
  );
};

export default ProductList;
